import React, { useState,useEffect } from 'react';
import axios from 'axios';


const Account = () => {
    useEffect( ()=>{
        axios.get("localhost:5000/quiz").then().catch()
    })    
    return (
        <div style={{textAlign: "center"}}>
            <p>Uploaded quizzes</p>
        </div>
    )
}

export default Account
